import { BigInt, ByteArray, log } from "@graphprotocol/graph-ts"
import { Nft, NftTransaction } from "../../generated/schema"

export namespace nfts {
	export function getOrCreateNft(
		tokenId: BigInt, contract: string
	): Nft {
		let id = contract + "-" + tokenId.toHexString()
		if (helpers.isIndexTooLarge(id)) {
			/* took from logs: getOrCreateNft :: isIndexTooLarge !! setting id to 'TOO_LARGE_INDEX' 
			 * · · · id(0xc99f70bfd82fb7c8f8191fdfbfb735606b15e5c5)
			 * · · · address(
			 * */
			log.warning(
				"\getOrCreateNft :: isIndexTooLarge !! setting id to 'TOO_LARGE_INDEX' \n · · · id( {} )\n · · · address( {} )\n !!! !!! !!! see: // INDEXER_ERROR: index row size 7536 exceeds btree version 4 maximum 2704",
				[contract, tokenId.toHexString()]
			)
			id = "TOO_LARGE_INDEX"
		}
		let entity = Nft.load(id)
		if (entity == null) {
			entity = new Nft(id)
			entity.contract = contract
			entity.tokenId = tokenId
		}
		return entity as Nft
	}
	export function changeNftOwner(
		tokenId: BigInt, contract: string, newOwner: string
	): Nft {
		let entity = getOrCreateNft(tokenId, contract)
		entity.owner = newOwner
		return entity as Nft
	}
	export function getOrCreateNftTransfer(
		nftId: string, // the nft entitiy id do not confuse with the tokenId
		timestamp: BigInt, from: string, to: string,
		sale: string
	): NftTransaction {
		let id = timestamp.toString().concat("-").concat(nftId)
		let entity = NftTransaction.load(id)
		if (entity == null) {
			entity = new NftTransaction(id)
			entity.nft = nftId
			entity.timestamp = timestamp
			entity.from = from
			entity.from = from
			entity.to = to
			entity.sale = sale
		}
		return entity as NftTransaction
	}
	export namespace helpers {

		export function isIndexTooLarge(id: string): bool {
			// avoid indexing if entity's id length is more than 2704 bytes
			// INDEXER_ERROR: index row size 7536 exceeds btree version 4 maximum 2704
			return ByteArray.fromUTF8(id).length > 2704
		}
	}
}

